function formatTime(strTime, strFormat) {

		if(strTime=='')
		{
			return '';
		}

		strTime = moment(strTime, strFormat).format();
		strTime = strTime.replace('T', ' ');
		strTime = strTime.substring(0, strTime.lastIndexOf('+'));
		var yyyy = strTime.substring(0, 4);
		var month = strTime.substr(5, 2);
		var dd = strTime.substr(8, 2);


		var hms;
		var hh;
		var mm;
		var ss;
		if(strFormat == 'YYYYMMDD  HH:mm:ss'||strFormat == 'YYYY-MM-DD HH:mm:ss')
		{
			 hms = strTime.split(' ')[1];
			 hh = hms.substring(0, 2);
			 mm = hms.substr(3, 2);
			 ss = hms.substr(6);
		}

		
		if (strFormat == 'YYYYMMDD') {
			strTime = yyyy + '' + month + '' + dd + '';
		} else if (strFormat == 'YYYYMMDD  HH:mm:ss') {
			strTime = yyyy + '' + month + '' + dd + '' + ' ' + hh + ':' + mm
					+ ':' + ss + '';
		} else if (strFormat == 'YYYY-MM-DD') {
			strTime = yyyy + '-' + month + '-' + dd;
		} else if (strFormat == 'YYYY/MM/DD') {
			strTime = yyyy + '/' + month + '/' + dd;
		} else if (strFormat == 'YYYY-MM-DD HH:mm:ss') {
			strTime = yyyy + '-' + month + '-' + dd + ' ' + hh + ':' + mm + ':'
					+ ss;
		} else if (strFormat == 'YYYY|MM|DD') {
			strTime = yyyy + '|' + month + '|' + dd;
		}
		return strTime;
	}
	
	

