//HH:mm:ss
function formatSingleTime(prop) {
	return function(){
		var time;
		if(typeof(this[prop])=="undefined")

		{
			time=this.toString();
		}

		else

		{	
			time=this[prop];
		}
		if(time.length<5){
			return time;
		}else if(time.length==5){
			time="0"+time;
		}
		return time.substring(0,2)+":"+time.substring(2,4)+":"+time.substring(4,6);
	};
}

